import React, { useState } from 'react';
import {
  Box,
  Button,
  Typography,
  Grid,
  Card,
  CardContent,
  CardActions,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  IconButton,
  Fab,
  Tooltip,
  Tab,
  Tabs,
  Paper,
} from '@mui/material';
import {
  Add as AddIcon,
  Edit as EditIcon,
  Delete as DeleteIcon,
  ContentCopy as ContentCopyIcon,
} from '@mui/icons-material';

const BookingForms = () => {
  const [forms, setForms] = useState([]);
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedForm, setSelectedForm] = useState(null);
  const [formTab, setFormTab] = useState(0);

  // Form dialog state
  const [formData, setFormData] = useState({
    title: '',
    duration: 30,
    type: 'google_meet',
    description: '',
    fields: [],
  });

  const handleCreateForm = () => {
    setSelectedForm(null);
    setFormData({
      title: '',
      duration: 30,
      type: 'google_meet',
      description: '',
      fields: [],
    });
    setOpenDialog(true);
  };

  const handleEditForm = (form) => {
    setSelectedForm(form);
    setFormData(form);
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setSelectedForm(null);
    setFormTab(0);
  };

  const handleSaveForm = () => {
    // TODO: Implement form saving logic
    handleCloseDialog();
  };

  const handleCopyShortcode = (formId) => {
    navigator.clipboard.writeText(`[wd_appointment_form id="${formId}"]`);
    // TODO: Show success notification
  };

  const renderFormDialog = () => {
    return (
      <Dialog
        open={openDialog}
        onClose={handleCloseDialog}
        maxWidth="md"
        fullWidth
      >
        <DialogTitle>
          {selectedForm ? 'Edit Booking Form' : 'Create Booking Form'}
        </DialogTitle>
        <DialogContent>
          <Box sx={{ borderBottom: 1, borderColor: 'divider', mb: 2 }}>
            <Tabs
              value={formTab}
              onChange={(e, newValue) => setFormTab(newValue)}
            >
              <Tab label="General" />
              <Tab label="Fields" />
              <Tab label="Schedule" />
              <Tab label="Notifications" />
            </Tabs>
          </Box>

          {formTab === 0 && (
            <Grid container spacing={2}>
              <Grid item xs={12}>
                <TextField
                  fullWidth
                  label="Form Title"
                  value={formData.title}
                  onChange={(e) =>
                    setFormData({ ...formData, title: e.target.value })
                  }
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  fullWidth
                  label="Duration (minutes)"
                  type="number"
                  value={formData.duration}
                  onChange={(e) =>
                    setFormData({ ...formData, duration: e.target.value })
                  }
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  fullWidth
                  multiline
                  rows={4}
                  label="Description/Instructions"
                  value={formData.description}
                  onChange={(e) =>
                    setFormData({ ...formData, description: e.target.value })
                  }
                />
              </Grid>
            </Grid>
          )}

          {formTab === 1 && (
            <Typography>Form fields configuration will go here</Typography>
          )}

          {formTab === 2 && (
            <Typography>Schedule settings will go here</Typography>
          )}

          {formTab === 3 && (
            <Typography>Notification settings will go here</Typography>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog}>Cancel</Button>
          <Button onClick={handleSaveForm} variant="contained" color="primary">
            Save
          </Button>
        </DialogActions>
      </Dialog>
    );
  };

  return (
    <Box>
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-bold text-gray-900">Booking Forms</h1>
        <Button onClick={handleCreateForm}>Create New Form</Button>
      </div>

      <div className="grid gap-4 md:grid-cols-2 lg:grid-cols-3">
        {forms.map((form) => (
          <Card key={form.id} className="relative">
            <CardHeader>
              <CardTitle>{form.title}</CardTitle>
              <CardDescription>{form.description}</CardDescription>
            </CardHeader>
            <CardContent>
              <div className="flex flex-col space-y-2">
                <div className="flex items-center justify-between">
                  <span className="text-sm text-muted-foreground">Status:</span>
                  <Badge variant={form.active ? 'default' : 'secondary'}>
                    {form.active ? 'Active' : 'Inactive'}
                  </Badge>
                </div>
                <div className="flex items-center justify-between">
                  <span className="text-sm text-muted-foreground">
                    Created:
                  </span>
                  <span className="text-sm">{form.created_at}</span>
                </div>
              </div>
            </CardContent>
            <CardFooter className="flex justify-end space-x-2">
              <Button
                variant="outline"
                size="sm"
                onClick={() => handleEditForm(form)}
              >
                Edit
              </Button>
              <Button
                variant="destructive"
                size="sm"
                onClick={() => handleDeleteForm(form)}
              >
                Delete
              </Button>
            </CardFooter>
          </Card>
        ))}
      </div>

      {renderFormDialog()}
    </Box>
  );
};

export default BookingForms;
